import logo from './logo.svg';
import './App.css';

function App() {
  return (

    <div className="App">
    <p>
      Arq Cloud
    </p>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Arq Cloud
        </p>

      </header>
    </div>
  );
}

export default App;
